import React, {useState} from 'react';
import { ReactSVG } from 'react-svg';
import diagramIcon from '../../../assets/svg/leaderboard.svg';
import accountIcon from '../../../assets/svg/people.svg';
import settingsIcon from '../../../assets/svg/settings.svg';
import cx from "classnames";

const Organization = () => {
    const [activeMenuTab, setActiveMenuTab] = useState('Dashboard');
    const setActiveMenuHandler = (tabName) => {
        setActiveMenuTab(tabName)
    }
    return(
        <div style={{ backgroundColor: 'black' }} className="organization-container">
            <div className="sidebar">
                <div className="organization-sidebar">
                    <div className="organization-sidebar__item" onClick={()=>setActiveMenuHandler('Dashboard')}>
                        <ReactSVG className={cx('svg', {"svg-active":activeMenuTab === 'Dashboard'})}  src={diagramIcon} /> Dashboard
                    </div>
                    <div className="organization-sidebar__item" onClick={()=>setActiveMenuHandler('Accounts')}>
                        <ReactSVG className={cx('svg', {"svg-active":activeMenuTab === 'Accounts'})}  src={accountIcon} /> Accounts
                    </div>
                    <div className="organization-sidebar__item" onClick={()=>setActiveMenuHandler('Settings')}>
                        <ReactSVG className={cx('svg', {"svg-active":activeMenuTab === 'Settings'})}  src={settingsIcon} /> Settings
                    </div>
                </div>
            </div>
            <div className="content">
                <div className="organization-container__heading">sadsadas</div>
            </div>
        </div>
    );
}
export default Organization;
